from collections import Counter
def w(n): return bin(n).count("1")
def aupton(nn):
    num, alst, inventory = 0, [0], Counter([0])
    for n in range(1, nn+1):
        c = inventory[num]
        num = 0 if c == 0 else num + 1
        alst.append(c)
        inventory.update([w(c)])
